// ============================================
// 🎯 병합 노드에서 프롬프트와 이미지 추출 (개선 버전)
// ============================================

const items = $input.all();

console.log('=== 디버깅 시작 ===');
console.log('받은 아이템 개수:', items.length);

// 초기화
let promptText = '';
let imageBase64 = '';

// 각 아이템 검사
for (let i = 0; i < items.length; i++) {
  const item = items[i];
  console.log(`\n--- 아이템 ${i} 분석 ---`);

  // ============================================
  // 프롬프트 찾기 (개선된 로직)
  // ============================================
  if (item.json) {
    console.log('JSON 키들:', Object.keys(item.json));

    // AI Agent 노드는 여러 가능한 출력 형식을 가질 수 있음
    const possibleTextFields = [
      'output',      // 일반적인 출력
      'text',        // 텍스트 응답
      'response',    // 응답
      'result',      // 결과
      'content',     // 컨텐츠
      'message'      // 메시지
    ];

    // 가능한 모든 필드를 순회하며 프롬프트 찾기
    for (const fieldName of possibleTextFields) {
      if (item.json[fieldName] && typeof item.json[fieldName] === 'string') {
        const textValue = item.json[fieldName];

        // Veo 프롬프트 특징으로 식별
        if (textValue.includes('Close-Up') || 
            textValue.includes('close-up') ||
            textValue.includes('ECU') ||
            textValue.includes('shot') ||
            textValue.includes('duration') ||
            textValue.includes('8-second') ||
            textValue.includes('8s') ||
            textValue.length > 100) {
          promptText = textValue;
          console.log(`✅ 프롬프트 발견! 필드: "${fieldName}", 길이:`, promptText.length);
          break;
        }
      }
    }

    // 여전히 못 찾았다면, 모든 문자열 값을 출력하여 디버깅
    if (!promptText) {
      console.log('⚠️ 프롬프트를 찾지 못했습니다. 사용 가능한 문자열 값들:');
      for (const key in item.json) {
        if (typeof item.json[key] === 'string' && item.json[key].length > 20) {
          console.log(`  - ${key}: "${item.json[key].substring(0, 50)}..."`);
        }
      }
    }
  }

  // ============================================
  // 이미지 찾기 (기존 로직 유지)
  // ============================================

  // Binary 데이터 확인
  if (item.binary) {
    console.log('Binary 키들:', Object.keys(item.binary));

    if (item.binary.data && item.binary.data.data) {
      imageBase64 = item.binary.data.data;
      console.log('✅ 이미지 발견 (binary.data.data)! 길이:', imageBase64.length);
    }
  }

  // JSON에 Gemini 응답이 있는 경우 (누끼 노드)
  if (!imageBase64 && item.json && item.json.candidates) {
    console.log('Gemini 응답 구조 확인 중...');
    try {
      const candidate = item.json.candidates[0];
      if (candidate && candidate.content && candidate.content.parts) {
        for (const part of candidate.content.parts) {
          if (part.inlineData && part.inlineData.data) {
            imageBase64 = part.inlineData.data;
            console.log('✅ 이미지 발견 (Gemini)! 길이:', imageBase64.length);
            break;
          }
        }
      }
    } catch (e) {
      console.log('⚠️ Gemini 응답 파싱 실패:', e.message);
    }
  }

  // JSON에 imageBase64 필드가 직접 있는 경우
  if (!imageBase64 && item.json && item.json.imageBase64) {
    imageBase64 = item.json.imageBase64;
    console.log('✅ 이미지 발견 (json.imageBase64)! 길이:', imageBase64.length);
  }
}

console.log('\n=== 최종 결과 ===');
console.log('프롬프트 있음:', !!promptText);
console.log('이미지 있음:', !!imageBase64);

// ============================================
// 검증 및 상세한 에러 메시지
// ============================================
if (!promptText) {
  console.error('\n❌ 프롬프트를 찾을 수 없습니다!');
  console.error('디버깅 정보:');
  console.error('- 받은 아이템 수:', items.length);
  items.forEach((item, idx) => {
    console.error(`\n아이템 ${idx} 구조:`);
    console.error('  JSON 키:', Object.keys(item.json || {}));
    if (item.json) {
      Object.keys(item.json).forEach(key => {
        const val = item.json[key];
        if (typeof val === 'string') {
          console.error(`  - ${key}: "${val.substring(0, 100)}${val.length > 100 ? '...' : ''}"`);
        }
      });
    }
  });

  throw new Error(
    '❌ 영상 프롬프트를 찾을 수 없습니다!\n\n' +
    '확인 사항:\n' +
    '1. "영상 생성 프롬프트" 노드가 실행되었나요?\n' +
    '2. "영상 생성 프롬프트" 노드가 "병합" 노드의 첫 번째 입력에 연결되어 있나요?\n' +
    '3. 위의 콘솔 로그에서 실제 출력 필드명을 확인하세요.\n\n' +
    'F12 → Console 탭에서 디버깅 정보를 확인하세요!'
  );
}

if (!imageBase64) {
  throw new Error(
    '❌ 이미지를 찾을 수 없습니다!\n\n' +
    '확인 사항:\n' +
    '1. "이미지생성1" 노드가 실행되었나요?\n' +
    '2. "Convert to File1" 노드가 "병합" 노드의 두 번째 입력에 연결되어 있나요?'
  );
}

// data: 프리픽스 제거 (있다면)
if (imageBase64.includes('data:image')) {
  console.log('⚠️ data: 프리픽스 발견, 제거 중...');
  imageBase64 = imageBase64.split(',')[1];
}

console.log('✅ 모든 데이터 준비 완료!');
console.log('프롬프트 미리보기:', promptText.substring(0, 100) + '...');
console.log('이미지 Base64 길이:', imageBase64.length);

// Veo 3.1 형식으로 반환
return {
  json: {
    promptText: promptText,
    imageBase64: imageBase64,
    // 디버깅 정보
    debug: {
      promptLength: promptText.length,
      imageLength: imageBase64.length,
      timestamp: new Date().toISOString()
    }
  }
};

