const items = $input.all();

console.log('=== 데이터 추출 시작 ===');
console.log('전체 아이템 수:', items.length);

let videoUri = '';
let videoFileName = '';
let subtitleContent = '';
let audioBase64 = '';

// 데이터 추출
for (let i = 0; i < items.length; i++) {
  const item = items[i];
  console.log(`\n--- 아이템 ${i} 분석 ---`);
  console.log('JSON 키:', Object.keys(item.json || {}));
  console.log('Binary 키:', Object.keys(item.binary || {}));

  // ===== 영상 파일명 =====
  if (item.json?.fileName && item.json.fileName.includes('input_video')) {
    videoFileName = item.json.fileName;
    console.log('✅ 영상 파일:', videoFileName);
  }

  // ===== 영상 URI =====
  if (item.json?.response?.generateVideoResponse) {
    const samples = item.json.response.generateVideoResponse.generatedSamples;
    if (samples?.[0]?.video?.uri) {
      videoUri = samples[0].video.uri;
      console.log('✅ 영상 URI 발견');
    }
  }

  // ===== 자막 (두 가지 필드 모두 확인!) =====
  if (item.json?.srtContent) {
    subtitleContent = item.json.srtContent;
    console.log('✅ 자막 발견 (srtContent):', subtitleContent.substring(0, 50));
  }

  if (item.json?.subtitleContent) {
    subtitleContent = item.json.subtitleContent;
    console.log('✅ 자막 발견 (subtitleContent):', subtitleContent.substring(0, 50));
  }

  // ===== TTS 오디오 =====
  if (i === 2 && item.binary?.data?.data) {
    audioBase64 = item.binary.data.data;
    console.log('✅ TTS 오디오 Binary 발견 (인덱스:', i + ')');
  }
}

// 검증
if (!videoFileName) throw new Error('영상 파일명 없음');
if (!subtitleContent) {
  console.error('❌ 자막을 찾을 수 없습니다!');
  console.error('전체 데이터:', JSON.stringify(items, null, 2));
  throw new Error('자막 없음');
}

// 타임스탬프
const timestamp = Date.now();
const baseDir = '/tmp/n8n_video';

console.log('\n=== 최종 확인 ===');
console.log('타임스탬프:', timestamp);
console.log('영상:', videoFileName);
console.log('자막 길이:', subtitleContent.length);
console.log('TTS 있음:', audioBase64 !== '');

return {
  json: {
    timestamp: timestamp,
    tmpDir: baseDir,
    videoUri: videoUri,
    videoPath: videoFileName,
    subtitlePath: `${baseDir}/subtitle_${timestamp}.srt`,
    audioPath: audioBase64 ? `${baseDir}/audio_${timestamp}.mp3` : '',
    outputPath: `${baseDir}/output_${timestamp}.mp4`,
    subtitleContent: subtitleContent,
    audioBase64: audioBase64,
    hasAudio: audioBase64 !== ''
  }
};

const subtitleContent = $json.subtitleContent;

console.log('=== 자막 처리 (파일 저장 건너뛰기) ===');

// ⭐ Binary 생성하지 않고, JSON만 전달
return {
  json: {
    timestamp: $json.timestamp,
    tmpDir: $json.tmpDir,
    videoUri: $json.videoUri,
    videoPath: $json.videoPath,
    subtitlePath: $json.subtitlePath,
    subtitleContent: subtitleContent,  // ⭐ 내용 유지
    audioPath: '',
    outputPath: $json.outputPath,
    hasAudio: false
  }
  // ⭐ Binary 없음 - 파일은 나중에 생성
};

const hasAudio = $json.hasAudio;
const audioBase64 = $json.audioBase64;

console.log('=== 오디오 Binary 변환 ===');
console.log('hasAudio:', hasAudio);
console.log('audioBase64 존재:', !!audioBase64);

// ⭐ 오디오가 있으면 Binary 생성
if (hasAudio && audioBase64) {
  console.log('✅ TTS 오디오 Binary 생성');

  return {
    json: {
      timestamp: $json.timestamp,
      tmpDir: $json.tmpDir,
      videoUri: $json.videoUri,
      videoPath: $json.videoPath,
      subtitlePath: $json.subtitlePath,
      subtitleContent: $json.subtitleContent,
      audioPath: $json.audioPath,
      outputPath: $json.outputPath,
      hasAudio: true
    },
    binary: {
      data: {
        data: audioBase64,
        mimeType: 'audio/mp3',
        fileName: 'audio.mp3'
      }
    }
  };
}

// 오디오 없음
console.log('⏭️ 오디오 없음');
return {
  json: {
    timestamp: $json.timestamp,
    tmpDir: $json.tmpDir,
    videoUri: $json.videoUri,
    videoPath: $json.videoPath,
    subtitlePath: $json.subtitlePath,
    subtitleContent: $json.subtitleContent,
    audioPath: '',
    outputPath: $json.outputPath,
    hasAudio: false
  }
};

const inputData = $input.first().json;

console.log('=== 경로 수집 ===');
console.log('videoPath:', inputData.videoPath);
console.log('subtitlePath:', inputData.subtitlePath);
console.log('subtitleContent 길이:', inputData.subtitleContent ? inputData.subtitleContent.length : 0);

return {
  json: {
    videoUri: inputData.videoUri || '',
    videoPath: inputData.videoPath,
    subtitlePath: inputData.subtitlePath,
    subtitleContent: inputData.subtitleContent,
    audioPath: '',
    outputPath: inputData.outputPath,
    hasAudio: false,
    tmpDir: '/tmp/n8n_video'
  }
};

// stdout에서 마지막 줄(파일 경로) 추출
const stdout = $input.item.json.stdout;

if (!stdout) {
  throw new Error('stdout이 비어있습니다');
}

// 마지막 줄 추출 (개행문자로 분리)
const lines = stdout.trim().split('\n');
const filePath = lines[lines.length - 1].trim();

// 파일 경로 검증
if (!filePath.startsWith('/') || !filePath.includes('.mp4')) {
  throw new Error(`유효하지 않은 파일 경로: ${filePath}`);
}

return {
  json: {
    filePath: filePath,
    originalStdout: stdout
  }
};

// ============================================
// 🎯 목적: Gemini API 응답에서 동적으로 이미지 데이터 찾기
// ============================================

// 입력 데이터 가져오기
const inputData = items[0].json;

// 이미지 데이터를 저장할 변수
let imageData = null;
let imageFound = false;

// candidates 배열 순회
if (inputData.candidates && Array.isArray(inputData.candidates)) {
  for (const candidate of inputData.candidates) {
    // content.parts 배열 확인
    if (candidate.content && candidate.content.parts && Array.isArray(candidate.content.parts)) {
      for (const part of candidate.content.parts) {
        // inlineData.data가 있는지 확인
        if (part.inlineData && part.inlineData.data) {
          imageData = part.inlineData.data;
          imageFound = true;
          console.log('✅ 이미지 데이터 발견! 경로:', JSON.stringify(part.inlineData.mimeType || 'unknown'));
          break; // 첫 번째 이미지 데이터를 찾으면 중단
        }
      }
      if (imageFound) break; // 외부 루프도 중단
    }
  }
}

// ============================================
// 결과 반환: 고정된 경로로 정규화
// ============================================
if (!imageFound || !imageData) {
  throw new Error('❌ Gemini API 응답에서 이미지 데이터를 찾을 수 없습니다. API 응답을 확인하세요.');
}

// 고정된 경로로 데이터 반환
return [{
  json: {
    imageBase64: imageData, // ← Convert to File 노드에서 이 경로 사용
    mimeType: 'image/png',
    originalResponse: inputData // 디버깅용 (선택사항)
  }
}];

// ⭐ Gemini 출력에서 텍스트 추출
const inputData = $json;
const scriptText = inputData.output;

console.log('=== 자막 생성 (텍스트 → SRT) ===');
console.log('입력 텍스트:', scriptText);

if (!scriptText) {
  throw new Error('❌ output 필드가 없습니다!');
}

// ⭐ 텍스트를 줄 단위로 분리
const lines = scriptText.trim().split('\n').filter(line => line.trim());

// ⭐ SRT 형식으로 변환
let srtContent = '';
const durationPerLine = 4; // 각 줄당 4초
let currentTime = 0;

lines.forEach((line, index) => {
  const startTime = currentTime;
  const endTime = currentTime + durationPerLine;

  // SRT 시간 형식 (00:00:01,500)
  const formatTime = (seconds) => {
    const h = Math.floor(seconds / 3600);
    const m = Math.floor((seconds % 3600) / 60);
    const s = Math.floor(seconds % 60);
    const ms = Math.floor((seconds % 1) * 1000);
    return `${String(h).padStart(2, '0')}:${String(m).padStart(2, '0')}:${String(s).padStart(2, '0')},${String(ms).padStart(3, '0')}`;
  };

  srtContent += `${index + 1}\n`;
  srtContent += `${formatTime(startTime)} --> ${formatTime(endTime)}\n`;
  srtContent += `${line}\n\n`;

  currentTime = endTime;
});

console.log('✅ SRT 변환 완료');
console.log('라인 수:', lines.length);
console.log('SRT 길이:', srtContent.length);

// ⭐ 다음 노드로 전달
const timestamp = Date.now();
const baseDir = '/tmp/n8n_video';

return {
  json: {
    timestamp: timestamp,
    tmpDir: baseDir,
    subtitlePath: `${baseDir}/subtitle_${timestamp}.srt`,
    subtitleContent: srtContent,
    outputPath: `${baseDir}/output_${timestamp}.mp4`,
    scriptText: scriptText,
    hasAudio: false
  }
};
